/* ------------------------------------------------------------------
                            SIDE MENU                      
------------------------------------------------------------------ */
(function() {

    var bodyEl = document.body,
        content = document.querySelector( 'body' ),
        openbtn = document.getElementById( 'do-side-menu-open-button' ),
        closebtn = document.getElementById( 'do-side-menu-close-button' ),
        isOpen = false;

    function init() {
        initEvents();
    }

    function initEvents() {
        openbtn.addEventListener( 'click', toggleMenu );
        if( closebtn ) {
            closebtn.addEventListener( 'click', toggleMenu );
        }

        // close the menu element if the target it´s not the menu element or one of its descendants..
        content.addEventListener( 'click', function(ev) {
            var target = ev.target;
            if( isOpen && target !== openbtn ) {
                toggleMenu();
            }
        } );
    }

    function toggleMenu() {
        if( isOpen ) {
            classie.remove( bodyEl, 'do-show-menu' );
        }
        else {
            classie.add( bodyEl, 'do-show-menu' );
        }
        isOpen = !isOpen;
    }

    init();

})();